import React from "react";
import './MainBody.css';

function MainBody() {
    return (
      <div className="main-body">
        {/* Dropdown 1 */}
        <div className="dropdown">
          <button className="dropdown-button">Kurskod</button>
          <div className="dropdown-content">
            <a href="#">Option 1</a>
            <a href="#">Option 2</a>
            <a href="#">Option 3</a>
          </div>
        </div>

        {/* Dropdown 2 */}
        <div className="dropdown">
          <button className="dropdown-button"></button>
          <div className="dropdown-content">
            <a href="#">Option 1</a>
            <a href="#">Option 2</a>
            <a href="#">Option 3</a>
          </div>
        </div>

        {/* Dropdown 3 */}
        <div className="dropdown">
          <button className="dropdown-button">Menu 3</button>
          <div className="dropdown-content">
            <a href="#">Option 1</a>
            <a href="#">Option 2</a>
            <a href="#">Option 3</a>
          </div>
        </div>
      </div>
    );
  }

  export default MainBody;
